import { ConfigurationService } from '../../src/services/configuration.service';
import { CommonService } from '../../src/services/common.service';

describe('ConfigurationService', () => {
    const commonService = new CommonService();
    const config = new ConfigurationService(commonService);

    it('getFragment()', function (done){
        config.getFragment('test').then(result => {
            expect(result).toBe(testDocxTestFragmentAsBase64String);
            done();
        });
    });

    it('getTemplate()', function (done){
        config.getTemplate('test').then(result => {
            expect(result).toBe(testDocXTestTemplateAsBase64String);
            done();
        });
    });

    it('getFragmentFilePath(name: string)', function (done) {
        config.getFragmentFilePath('test').then(result => {
            expect(result).toBe('assets/fragmente/test.docx');
            done();
        });
    });

    it('getTemplateFilePath(name: string)', function (done) {
        config.getTemplateFilePath('test').then(result => {
            expect(result).toBe('assets/vorlagen/test.docx');
            done();
        });
    });

    it('getFragments()', function (done) {
        config.getFragments().then(result => {
            expect(result).toEqual(jasmine.objectContaining({ test: 'fragmente/test.docx' }));
            done();
        });
    });

    it('getTemplates()', function (done) {
        config.getTemplates().then(result => {
            expect(result).toEqual(jasmine.objectContaining({ test: 'vorlagen/test.docx' }));
            done();
        });
    });

    const testDocxTestFragmentAsBase64String = ''
    
    const testDocXTestTemplateAsBase64String = '';
});
